import React from 'react'
import PropTypes from 'prop-types'

const Header = ({title}) => {
  return (
    <div>
      <h1 style={{color}}>{title}</h1>
    </div>
  )
}
Header.propTypes = {
    title: propTypes.string
}



export default Header
